import UserBlockStlyed from "../styled/commonStyled/UserBlockStyled";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const Comment = ({ comment }) => {
  return (
    <CommentWrapper>
      <UserBlockStlyed>
        <UserProfileStyled
          src="../../public/logo192.png"
          width="32px"
          height="32px"
        />
        <p>{comment.author}</p>
      </UserBlockStlyed>
      {comment.contents}
    </CommentWrapper>
  );
};

